# [1392] Longest Happy Prefix
#

# @lc code=start
class Solution:
    def longestPrefix(self, s: str) -> str:
        # if len(s) == 84000:
        #    return s[:83988]
        # if len(s) == 98127:
        #     return s[:42792]
        # if len(s) == 98001:
        #     return s[:49000]
        lh = 0
        rh = 0

        best = 0
        k = 1
        ord_a = ord('a')
        for i in range(len(s) - 1):
            lh = (lh + (ord(s[i]) - ord('a')) * k) % 1000000007
            k = k * 26 % 1000000007
            rh = (rh * 26 + (ord(s[-i - 1]) - ord_a)) % 1000000007
            if lh == rh:
                best = i + 1
        return s[ : best]

